    studies done on Clarence Cannon NWR and Mark Twain NWR, Annada District. The objective
    of one study was to inventory the breeding birds, both game and nongame, present
    within the boundaries of the refuge and to identify the types of habitat being used.
    The objectives of the second study were to survey seven moist soil units for the
    presence of nesting marsh and waterbirds and to document nest characteristics.",nt"owner_org":
